                  </tr>{" "}
                  <tr>
                    {" "}
                    <td>heading</td> <td>{this.props.coords.heading}</td>{" "}
                  </tr>{" "}
                  <tr>
                    {" "}
                    <td>speed</td> <td>{this.props.coords.speed}</td>{" "}
                  </tr>{" "}
                </tbody>{" "}
              </table>
            ) : (
              <div>Getting the location dataâ€¦ </div>
            );
          };
export default GoogleMaps;
